import { Container, Box, Grid } from "@mui/material";
import GenericInputField from "./TextField";

export default function UserEntry() {
  return (
    <>
      {/* <Container maxWidth="sm">
        <Box sx={{ bgcolor: "red", height: "50vh" }} />
      </Container> */}
      <Grid
        container
        direction="column"
        spacing={2}
        justifyContent="center"
        alignItems="center"
      >
        <Grid item xs={12}>
          <GenericInputField label="FirstName" helperText="FirstName" />
        </Grid>
        <Grid item xs={6}>
          <GenericInputField label="LastName" helperText="LastName" />
        </Grid>
        <Grid item xs={6}>
          <GenericInputField label="Email" helperText="Email" />
        </Grid>
      </Grid>
    </>
  );
}
